import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Logon from './pages/logon';

export default function Router(){
    return(
        <BrowserRouter>
            <Switch>
                <Router path="/" component={Logon}/>
            </Switch>
        </BrowserRouter>
    );
}
